    null,nt"notes": "GSA Auctions offers Federal personal property assets ranging
    from common place items (such as office equipment and furniture) to more select
    products like scientific equipment, heavy machinery, airplanes, vessels and vehicles.
    GSA Auctionsu2019 online capabilities allow GSA to offer assets located across the
    country to any interested buyer, regardless of location.    Build your own tools
    using our API to access GSA Auctions listings.  The Auctions API is a GET API which
    has currently one operation. The operation will retrieve GSA Auctions data.  The
    output data will be in XML and JSON format. These files are downloadable.  The data
    in the API output file is live data.",nt"license_title": "Creative Commons
